import React, { Component } from "react";

// COMPONENTS
import Icono from "components/Icono/Icono";

function Clima() {
	return (
		<section id="clima">
			<h2>
				<Icono nombre="flood" />
				Clima
			</h2>
			<ClimaEspecifico />
		</section>
	)
}

export default Clima;
